import {Router,Routes,Route} from 'react-router-dom';
import LandingPage from './pages/landing';
function App() {
  return (
    <>
    <Router>
     <Routes>
      <Route path='/' element={<LandingPage/>} />
<h1>Dwaipayan</h1>
     </Routes>
    </Router>
    </>
  );
}

export default App;
